import Card from "./Card";
import sData from "./SData";

function App() {
  const d = new Date(2023, 1);
  const ncard = (val) => (
    <Card
      key={val.id}
      imgsrc={val.imgsrc}
      title={val.title}
      sname={val.sname}
      link={val.link}
    />
  );
  return (
    <>
      <h1 className="heading_style">
        list top {sData.length} netflix series in {d.getFullYear()}
      </h1>
      {sData.map(ncard)}
    </>
  );
}

export default App;
